pragma solidity ^0.4.24;

import "./Ownable.sol";

contract Admin is Ownable {

  uint adminCount;
  mapping(address => bool) admins;

  event addAdminEvent(
    address indexed user
  );

  event removeAdminEvent(
    address indexed user
  );

  modifier onlyAdmin {
    require(
      admins[msg.sender] == true,
      "Only adminstrators are allowed to call this function."
    );
    _;
  }

  modifier isSender(address _address) {
    require(
      _address == msg.sender,
      "Address must match caller."
    );
    _;
  }

  constructor() public {
    owner = msg.sender;
    admins[msg.sender] = true;
    adminCount = 1;
  }

  function addAdmin(address _address)
    public
    onlyAdmin
    returns(bool)
  {
    require(
      _address != address(0),
      "A valid user address must be provided."
    );
    admins[_address] = true;
    adminCount++;
    emit addAdminEvent(_address);
    return true;
  }

  function removeAdmin(address _address)
    public
    onlyAdmin
    returns(bool)
  {
    require(_address != owner, "Contract owner cannot be removed as admin.");
    admins[_address] = false;
    adminCount--;
    emit removeAdminEvent(_address);
    return true;
  }

  function isAdmin(address _address)
    public view
    returns(bool)
  {
    if (admins[_address]) {
      return true;
    } else {
      return false;
    }
  }

}
